# Convert voteMatrix to numpy array
vote_matrix = np.array(voteMatrix)

# Function to perform K-means clustering and calculate silhouette score
def kmeans_silhouette(data, k):
    kmeans = KMeans(n_clusters=k, random_state=42)
    cluster_labels = kmeans.fit_predict(data)
    silhouette_avg = silhouette_score(data, cluster_labels)
    return silhouette_avg, kmeans

# Calculate silhouette scores for K=2 to K=9
silhouette_scores = []
k_values = range(2, 10)

for k in k_values:
    score, _ = kmeans_silhouette(vote_matrix, k)
    silhouette_scores.append(score)
    print(f"Silhouette Coefficient for K={k}: {score:.4f}")

# Find the K with the highest silhouette score
optimal_k = k_values[np.argmax(silhouette_scores)]
print(f"\nOptimal K value: {optimal_k}")

# Perform K-means clustering with the optimal K
_, kmeans = kmeans_silhouette(vote_matrix, optimal_k)

# Get cluster sizes
cluster_sizes = np.bincount(kmeans.labels_)
sorted_sizes = sorted(cluster_sizes, reverse=True)

print("\nCluster sizes (big to small):")
for i, size in enumerate(sorted_sizes):
    print(f"Cluster {i+1}: {size}")

# Plot silhouette scores
plt.figure(figsize=(10, 6))
plt.plot(k_values, silhouette_scores, 'bo-')
plt.xlabel('Number of Clusters (K)')
plt.ylabel('Silhouette Score')
plt.title('Silhouette Score vs. Number of Clusters')
plt.show()